'use strict';

require('ui/visualize/spy');

require('ui/visualize/visualize.less');

require('ui/visualize/visualize_legend');

var _modules = require('ui/modules');

require('angular-sanitize');

var _vis_editor_types = require('ui/registry/vis_editor_types');

var _update_status = require('ui/vis/update_status');

_modules.uiModules.get('kibana/directive', ['ngSanitize']).directive('visualizationEditor', function (Private, $timeout) {
  var editorTypes = Private(_vis_editor_types.VisEditorTypesRegistryProvider);

  return {
    restrict: 'E',
    scope: {
      showSpyPanel: '=',
      vis: '=',
      visData: '=',
      uiState: '=?',
      searchSource: '='
    },
    link: function link($scope, element) {
      // Clone the _vis instance.
      var vis = $scope.vis;
      var Editor = typeof vis.type.editor === 'function' ? vis.type.editor : editorTypes.find(function (editor) {
        return editor.key === vis.type.editor;
      });
      var editor = new Editor(element[0], vis, $scope.showSpyPanel);

      $scope.renderFunction = function () {
        if (!$scope.vis) return;
        editor.render($scope.visData, $scope.searchSource, (0, _update_status.getUpdateStatus)($scope), $scope.uiState);
      };

      $scope.$on('render', function (event) {
        event.preventDefault();
        $timeout(function () {
          $scope.renderFunction();
        });
      });

      $scope.$on('$destroy', function () {
        editor.destroy();
      });

      if (!vis.initialized) {
        $timeout(function () {
          $scope.renderFunction();
        });
      }
    }
  };
});
